import React from 'react'
import { connect } from 'react-redux';

const AddTaskListForm = ({setTaskList, taskList}) => {


  const formSubmit = e =>{
    e.preventDefault();

  }

  return(
    <div className="add-task-list-form">
      <form>
        <label>Input name new dashboard</label>

        <input className="column-title"></input>

        <div className="form-footer">

          <button className="add-column-btn" 
                  type="submit" 
                  onClick={formSubmit}>Add</button>

          <button className="close" 
                  type="button" 
                  onClick={()=>{setTaskList(false)}}>
            &times;
          </button>

        </div>
      </form>
    </div>
  )
}

const mapStateToProps = ({allTasks:taskList}) => ({taskList})

export default connect(mapStateToProps, null)(AddTaskListForm);
